import Head from "next/head";

const Layout = (props) => (
    <div>
        <Head>
            <title>ClickmeGuy</title>
            <link 
                rel="stylesheet"
                href="https://unpkg.com/@material-ui/core@latest/umd/material-ui.development.jss" />
        </Head>
        {/* <BODY> */}
        {/* <NavBar /> */}
        <div className="container">
            {props.children}
        </div>
        {/* </BODY> */}

    </div>
);

export default Layout
